import React from "react";
import ".././App.css";
import Card from "react-bootstrap/Card";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";

import Food1 from "../images/cards/1.jpeg";
import Food2 from "../images/cards/2.png";
import Food3 from "../images/cards/3.png";
import Food4 from "../images/cards/4.jpg";
import Food5 from "../images/cards/5.jpg";
// import Slide1 from "../images/img1.jpg";
// import Slide2 from "../images/img2.jpg";
// import Slide3 from "../images/img3.jpg";
//import Jumbotron from 'react-bootstrap/Jumbotron';
import Button from "react-bootstrap/Button";

function meals() {
  return (
    <>
    <br />

      <h1>
        <span>Meals</span>
      </h1>
      <h3>
        <span text-align = "center">Food experience with locals</span>
      </h3>
      <br />
      <Row className="pt-3 pb-5 align-items-center">
      <Col xs={12} md={4}>

      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src={Food1} />
        <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>

      </Col>

      <Col xs={12} md={4}>

      <Card style={{ width: "18rem" }}>
        <Card.Img variant="top" src={Food2} />
        <Card.Body>
          <Card.Title>Card Title</Card.Title>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
      </Col>

      </Row>
    </>
  );
}
export default meals;
